$templateCache.put("templates/chiSiamoContent.html","<update-title title=\"Annacloud.it - Chi Siamo\"></update-title><update-meta http-equiv=Content-Language content=es></update-meta><update-meta name=description content=\"Annacloud nasce dall’incontro tra tradizione e innovazione e dall’interpretazione in chiave digitale e social di tutto il processo di creazione di una borsa da donna.\"></update-meta><update-meta property=og:title content=\"Annacloud.it - Chi Siamo\"></update-meta><update-meta property=og:description content=\"Annacloud nasce dall’incontro tra tradizione e innovazione e dall’interpretazione in chiave digitale e social di tutto il processo di creazione di una borsa da donna.\"></update-meta><update-meta itemprop=description content=\"Annacloud nasce dall’incontro tra tradizione e innovazione e dall’interpretazione in chiave digitale e social di tutto il processo di creazione di una borsa da donna.\"></update-meta><update-script content=structuredData type=application/ld+json></update-script><div class=contatti-content><div class=\"container-fluid text-justify\"><div class=\"row narrazione\"><div class=\"col-sm-6 no-padding no-margin clearfix bottom-buffer wow fadeInUpSmall visible-xs\" data-wow-delay=.2s style=\"background: url(images/team-img-2-bg.jpg) center center no-repeat; background-size: cover; background-color: #fff\"><img src=images/team-img-2-bg.jpg class=\"hidden visible-xs\"></div><div class=\"col-sm-6 no-padding no-margin clearfix bottom-buffer wow fadeInUpSmall\" data-wow-delay=.2s><div class=content><h3 style=\"font-weight: lighter\" class=text-center>Chi siamo</h3><p class=text>Anna Cloud nasce dalla passione di due giovanissimi imprenditori toscani, Andrea e Luca, che hanno deciso di cambiare le regole dell’alta moda ideando un nuovo concept di pelletteria.</p><p class=text>Questa visione nasce dall’incontro tra tradizione e innovazione e dall’interpretazione in chiave digitale e social di tutto il processo di creazione di una borsa da donna.</p><p class=text>La parte produttiva è gestita interamente “in casa”. Luca, infatti, è pellettiere da due generazioni, già fornitore di prodotti di altissima fattura per le pi&ugrave; importanti firme..</p><p class=text>Ma come rendere un prodotto di alta qualità economicamente accessibile? E soprattutto: come trasformare radicalmente l’esperienza di acquisto?</p><p class=text>Qui entra in gioco la tecnologia, con un configuratore 3D realizzato su misura, capace di offrire un alto livello di personalizzazione e una qualità foto-realistica dei prodotti. Il processo produttivo infine viene condiviso passo passo con il cliente che avrà il piacere e la consapevolezza di aver acquistato un oggetto unico.</p></div></div><div class=\"col-sm-6 no-padding no-margin clearfix bottom-buffer wow fadeInUpSmall hidden-xs\" data-wow-delay=.2s style=\"background: url(images/team-img-2-bg.jpg) center center no-repeat; background-size: cover; background-color: #fff\"><img src=images/team-img-2-bg.jpg class=\"hidden visible-xs\"></div></div><div class=row style=\"min-height: 100px; background:#F6F6F6\"><div class=\"col-sm-12 clearfix top-buffer home-content wow fadeInUpSmall\"></div></div></div></div>");
